import ExpenseItem from "./ExpenseItem";
import "./Expenses_List.css";

const Expenses_List = (props) => {
  let expensesContent = <p>No content was found...</p>;

  if (props.items.length > 0) {
    expensesContent = props.items.map((expense) => (
      <ExpenseItem
        key={expense.id}
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      />
    ));
  }
  return <ul className="expenses-list"></ul>;
};

export default Expenses_List;
